import React from "react";
import { AboutUs } from "./aboutUsComponent";
import Footer from "./footer";
import { MvSpecialModel } from "./mvSpecialModel";
import SlideImgHomepage from "./slideImgHomePage";
import TypeMotor from "./typeMotor";
function handleClick() {
  for (
    var i = 0;
    i < document.getElementsByClassName("motorType").length;
    i++
  ) {
    document
      .getElementsByClassName("motorType")
      [i].classList.remove("type-chosen");
  }
  // document.getElementsByClassName('motorType')[chosen].classList.add('type-chosen');
  this.classList.add("type-chosen");
}
function openMotorList() {
  document.getElementById("motor-list").style.width = "100vw";
  document.getElementById("motor-list").style.width = "100vw";
  document.getElementById("motor-list").style.opacity = "1";
  document.getElementsByClassName("motorList-container-left")[0].style.width =
    "40%";
  document.getElementsByClassName(
    "motorList-container-left"
  )[0].style.opacity = 1;
  for (
    var i = 0;
    i < document.getElementsByClassName("motorType").length;
    i++
  ) {
    document
      .getElementsByClassName("motorType")
      [i].classList.remove("type-chosen");
    document
      .getElementsByClassName("motorType")
      [i].addEventListener("click", handleClick, true);
  }
  document.getElementsByClassName("motorType")[0].classList.add("type-chosen");
}
function displayMainMenu() {
  document.getElementById("mv-nav").classList.toggle("openMainMenu");
}
export function BodyHomepage() {
  return (
    <>
      
      <div className="mv-bg" id="main-bg">
        <SlideImgHomepage />
      </div>
      <div className="mv-about-us" id="mv-about-us">
        <AboutUs />
      </div>
      <div className="mv-special-model" id="mv-special-model">
        <MvSpecialModel />
      </div>
      <div className="mv-special-part">
        <div className="left-part">
          <div className="left-content">
            <a>APPAREL</a>
          </div>
        </div>
        <div className="right-part">
          <div className="right-content">
            <a>SPECIAL PARTS</a>
          </div>
        </div>
      </div>
      <div className="email-container">
        <p className="email-subscribe">SUBSCRIBE TO OUR NEWSLETTER</p>
        <div className="your-email">
          <p>YOUR E-MAIL</p>
        </div>
        <p className="policy" style={{ display: "inline" }}>
          *by sending us e-mail address, you agree with our&nbsp
          <a style={{ display: "inline" }}> privacy policy</a>
        </p>
      </div>
      <Footer />
    </>
  );
}
